import type { ReactElement } from 'react';
import type { Story } from '@storybook/react';
import { useForm, FormProvider } from 'react-hook-form';
import type { IUploadingImage } from './IUploadingImage';
import UploadingImage from './UploadingImage';

export default {
  title: 'molecules/UploadingImage',
  component: UploadingImage,
};

const Template: Story<IUploadingImage.IProps> = (args): ReactElement => {
  const methods = useForm({
    mode: 'onSubmit',
    reValidateMode: 'onChange',
  });
  return (
    <FormProvider {...methods}>
      <UploadingImage {...args} />
    </FormProvider>
  );
};

const dataURLtoFile = (dataurl: string, filename: string): File => {
  const arr = dataurl.split(',');
  const mime = 'image/jpeg';
  const bstr = atob(arr[1]);
  let n = bstr.length;
  const u8arr = new Uint8Array(n);
  while (n > 0) {
    n -= 1;
    u8arr[n] = bstr.charCodeAt(n);
  }

  return new File([u8arr], filename, { type: mime });
};

const file = dataURLtoFile(
  'data:image/jpeg;base64,',
  'image.jpeg',
);
export const Default = Template.bind({});
Default.args = {
  handleVerticalThreeDotsClick: (): void => undefined,
  file,
};
